import React from "react";
import { Link } from "react-router-dom";
import ASSETS from "../Assets";

export default function News(props) {
    return (
        <tr>
            <td>
                <img src={ASSETS.IMAGES.hand_globe} alt="logo-green" />
            </td>
            <td>
                <Link to={props.link}>{props.title}</Link>
            </td>
        </tr>
    );
}
